import React from "react";
import Card from "../card";

const Times = (props) => {
    return(
        <section style={{backgroundColor: props.corSecundaria}} className="p-12 text-center ">
           <h3 className="p-3 m-3 font-bold">{props.nome}</h3>

                {props.atletas.map(atleta => <Card 
                    nome={atleta.nome} 
                    cargo={atleta.cargo} 
                    imagem={atleta.imagem}
                />)}

        </section>
    )
}
export default Times;
